import React, {useState, useContext} from 'react'

//MUI Stuff
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import Button from '@material-ui/core/Button'
import { Link } from 'react-router-dom'
import Signup from '../pages/Signup'
import Login from '../pages/Login'
import FarmerHarvestPhotos from "./FarmerHarvestPhotos.js"
import { Route, Switch } from 'react-router-dom'
import FarmerHarvestList from '../components/FarmerHarvestList'
import {HarvestContext} from '../context/HarvestProvider'


function Navbar(props){

const [toggle, setToggle]= useState(true)
const [ hideform, setHideform ] = useState(false)
const [isClicked, setIsClicked] = useState(false)
const [myHarvestIsClicked, setMyHarvestIsClicked] = useState(false)
const {home, setHome} = useContext(HarvestContext)


const handleSignupLogin =()=> {
    if(toggle === true){

   return( 
    <div>
   <Signup  color="inherit" setHideform={setHideform} hideform={hideform}/>
   </div>
   )
    }
    if(toggle === false){

    return(
    <div>
       <Login   color="inherit" setHideform={setHideform} hideform={hideform}/>
    </div>
   )
    }
}
const handleToggleLogin=()=>{

    setToggle(false)
    setHideform(false)


}
const handleToggleSignup=()=>{

   setToggle(true) 
   setHideform(false)


}

return (
    <AppBar >
        <Toolbar>
            <Button 
            color="inherit"  
            onClick={()=> {

                setIsClicked(false)
                setMyHarvestIsClicked(false)
                setHome(true)
            }}
            component={Link} to='/'>
                Home
            </Button>

            <Button 
            color="inherit"  
            onClick={handleToggleLogin} 
            to='/login'>
                Login
            </Button>

            <Button 
            color="inherit" 
            onClick={handleToggleSignup} 
            to='/signup'>
                Signup
            </Button>

            <div >
                <Button 
                className={!hideform &&'hide-container'} 
                color="inherit" 
                component={Link} 
                to='/farmer-harvest'
                onClick={()=> setIsClicked(true) && setHome(false)}
                >
                    Farmer's Harvest Page
                </Button>
                <Button 
                className={!hideform &&'hide-container'} 
                color="inherit" 
                component={Link} 
                to='/farmer-harvest'
                onClick={()=> setIsClicked(!isClicked)}
                >
                    Image Search
                </Button>
                <Button 
                className={!hideform &&'hide-container'} 
                color="inherit" 
                component={Link} 
                to='/farmer-harvest'
                onClick={()=> setMyHarvestIsClicked(!myHarvestIsClicked)}
                >
                    My Harvests
                </Button>

              {handleSignupLogin()}

            </div>
        </Toolbar>
        <h1 className="header-text" >Urban Harvest</h1>
        <h2 className="no-waste">No waste is good waste.</h2>
        <>
        <FarmerHarvestPhotos isClicked={isClicked} />
        <FarmerHarvestList myHarvestIsClicked={myHarvestIsClicked}/>
        </>
    </AppBar>
)


}

export default Navbar
